description:
Plot:	In New Orleans| the hit men James Bonomo| a.k.a. Jimmy Bobo| and Louis Blanchard execute the dirty cop Hank Greely in a hotel room. But they are betrayed and Louis
is stabbed in a bar by the mercenary Keegan while waiting for the payment of the contract. Meanwhile the Washington D.C. police detective Taylor Kwon comes to New
Orleans to investigate the murder of Greely| who had stolen evidences from the Police Department. Soon he is shot by two dirty detectives but Jimmy saves his life.
Jimmy brings Taylor to the shop of his daughter Lisa and she removes the bullet from his shoulder and nurses him. Taylor and Jimmy form the most unlikely partnership
to investigate the crimes and after contacting the intermediate Ronni

